import React, { useState, useEffect } from 'react'
import Details from './Details';
import style from './recipe.module.css';
import { BrowserRouter, Route, Switch, Link } from 'react-router-dom';
import { Component } from 'react';



function Recipes({ idUri, title, calories, image, ingredients, meal, diet, cuisine }) {
    class Recipe extends React.Component {

        render() {
            return (
    
                <><Details
    
                    idUri={idUri}
                    title={title}
                    calories={calories}
                    image={image}
                    ingredients={ingredients}
                    cuisine={cuisine}
                    diet={diet}
                    meal={meal}
    
                /></>
    
            );
        }
    }
    
   

    return (
        <div className="col-4">
            <div className="card mb-3 mt-3">
                <div className="row">
                    <div className="col-5">
                        <img className={style.image} src={image} alt="" />
                    </div>
                    <div className="col-7">
                        <div className="row">
                            <div className="col-12">
                                <div className={style.title}>{title}</div>
                            </div>
                        </div>



                        <div className="row"><div className="col-12"><div className={style.meal}><p>{meal}</p></div></div></div>
                        <div className="row"><div className="col-12"><div className={style.diet}><p>{diet}</p></div></div></div>
                        <div className="row"><div className="col-12"><div className={style.cuisine}><p>{cuisine} cuisine</p></div></div></div>
                        <div className="row"><div className="col-12"><div className="button" ><Link className="nav-link" to="/details">Taste It</Link></div></div></div>









                    </div>
                </div>
            </div>
        </div>
    );
}

export default Recipes;
